import React from 'react';

const petAdvice = () => {
  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-2xl font-bold mb-4">New Page</h1>
      <div className="flex flex-col md:flex-row">
        <div className="md:w-1/2 p-4 bg-gray-100">
          <h2 className="text-xl font-semibold mb-2">Left Column</h2>
          <p>This is the content for the left column.</p>
        </div>
        <div className="md:w-1/2 p-4 bg-gray-200">
          <h2 className="text-xl font-semibold mb-2">Right Column</h2>
          <p>This is the content for the right column.</p>
        </div>
      </div>
    </div>
  );
};

export default petAdvice;
